import ListItem from "./listDeviceItem"

const renderList = (item, display) => {
  let container = []
  let i = 0
  while (i < 100) {
    if (!item[i]) break
    container.push(item[i])
    i++
  }
  
  if (display) {
    return container.map((item, i) => (
      <ListDeviceItem
        key={`ID${i}D`}
        item1={item[0].data}
        item2={item[1].data}
        item3={item[2].data}
        item4={item[3].data}
        item5={item[4].data}
        item6={item[5].data}
      />
    ));
  }
};

export default renderDeviceList
